Static variables are of two types:
1. Internal Static Variables: These are the variables which are declared with the keyword static inside a function. They are initialized only once at compile time and they retain their values between different function calls.
2. External Static Variables: These are the variables which are declared with the keyword static outside a function. They are initialized only once at compile time and they retain their values between different function calls. They are accessible only within the file in which they are declared.
Register variables are those variables which are declared with the keyword register. They are stored in the CPU registers instead of RAM. They are used to increase the speed of the program. They are used for those variables which are used frequently in the program.
The main difference between static variables and register variables is that static variables are stored in the memory and retain their values between different function calls, while register variables are stored in the CPU registers and do not retain their values between different function calls.
